import React from 'react'
import { connect } from 'react-redux';
import {toggleSubMenu} from '../../redux/menu/menu-action'
import { toggleCart } from '../../redux/menu/menu-selector';



export const SubNav=({Title,Link,Items,toggleSubMenu,toggleMenu})=>
(

        <div>
            <h3 onClick={()=>toggleSubMenu()}>{Title}</h3>

        {Items.map(subItem=>(<li>{subItem.Title}</li> ))


             


        }

        </div>

)

const mapDispatchToProps = (dispatch) => ({

    toggleSubMenu:()=>dispatch(toggleSubMenu())
  });
  const mapStateToProps = (state) => ({
    
    toggleMenu:toggleCart(state)
  });

export default connect(mapStateToProps,mapDispatchToProps) (SubNav)
